  false,\n\t\"url\": null,\n\t\"notes\": \"These data represent the location of Danger
  Zones and Restricted Areas within coastal and marine waters, as outlined by the
  Code of Federal Regulations (CFR) and the Raster Navigational Charts (RNC). The
  CFR defines a Danger Zone as, \"A defined water area (or areas) used for target
  practice, bombing, rocket firing or other especially hazardous operations, normally
  for the armed forces. The danger zones may be closed to the public on a full-time
  or intermittent basis, as stated in the regulations.\" The CFR defines a Restricted
  Area as, \"A defined water area for the purpose of prohibiting or limiting public
  access to the area. Restricted areas generally provide security for Government property
  and/or protection to the public from the risks of damage or injury arising from
  the Government's use of that area.\" Authoritative information relating to these
  data may be found in Title 33, Chapter II of the CFR (Part 334).\",\n\t\"license_title\":
